Annotations

An information containing the descriptive language from this section is not deficient if it contains an incorrect trade name description, since the use of said language is unnecessary to constitute a proper charge and is mere surplusage. State v. Spiegel, 239 Neb. 233, 474 N.W.2d 873 (1991).

Under subsections (c)(10) and (c)(15) of this section and section 28-404, marijuana is a Schedule I controlled substance, and thus is a "drug." State v. Finnegan, 232 Neb. 75, 439 N.W.2d 496 (1989).
